'''Gunslik''' is the owner of [[Gunslik's Assorted Items]], a [[general store]] found in the wealthy half of [[Keldagrim]]. Gunslik's shop stocks a variety of wares, ranging from basic supplies such as [[empty pot]]s to slightly more difficult-to-obtain items such as [[charcoal]] and [[rope]].

